import '../../data/models/time_price_dto.dart';class TimePrice {  TimePrice({    this.id,    this.name,  });  TimePrice.fromJson(dynamic json) {    id = json['id'];    name = json['name'];  }  int? id;  String? name;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['name'] = name;    return map;  }  factory TimePrice.fromDto(TimePriceDto json) {    return TimePrice(      id: json.id,      name: json.name,    );  }}